import React from "react";
import tasks from "./data"

const TaskGrid = () => {
  return (
    <table className='taskGrid' >
      <thead>
        <tr>
          <th></th>
          <th>Name</th>
          <th>Description</th>
          <th>Estimate</th>
          <th>State</th>
        </tr>
      </thead>     
      <tbody>
        {tasks.map(data => (
          <tr>
            <td><input type='checkbox'></input></td>
            <td>{data.name}</td>
            <td>{data.description}</td>
            <td>{data.estimateEndDate}</td>
            <td>{data.beginDate}</td> 
          </tr>
        ))}
        
      </tbody> 
    </table>
  );
};

export default TaskGrid;
